import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBars, faGlobe } from '@fortawesome/free-solid-svg-icons';
import './navbar.css';

function Navbar() {
  // State to track whether the mobile menu is open or closed
  const [isOpen, setIsOpen] = useState(false);

  // Function to toggle the mobile menu visibility
  const toggleNavbar = () => {
    setIsOpen(!isOpen);
  };

  return (
    <nav className="navbar">
      <div className="navbar-header">
        {/* Hamburger icon will only be shown in mobile view */}
        <div className="navbar-hamburger" onClick={toggleNavbar}>
          <FontAwesomeIcon icon={faBars} />
        </div>
        <div className="navbar-logo">
          <h1>Business Solution</h1>
        </div>
      </div>

      {/* Navbar for wider screens */}
      <div className='navbar1'>
        <ul className='navbar-menu'>
          <li>Driver</li>
          <li>Rider</li>
          <li>Business</li>
          <li>Log in</li>
          <li>Sign up</li>
          <li><FontAwesomeIcon icon={faGlobe} /> En</li>
        </ul>
      </div>

      <div className='navbar2'>
        <ul className='navbar-menu2'>
          <li>Products</li>
          <li>Solutions</li>
          <li>Customers</li>
          <li>Resources</li>
          <li>Contact us</li>
          <li>Get started</li>
        </ul>
      </div>

      {/* Conditional rendering for mobile menu */}
      {isOpen && (
        <div className="mobile-menu">
          <ul>
            <li>Driver</li>
            <li>Rider</li>
            <li>Business</li>
            <li>Log in</li>
            <li>Sign up</li>
            <li><FontAwesomeIcon icon={faGlobe} /> En</li>
            <li>Products</li>
            <li>Solutions</li>
            <li>Customers</li>
            <li>Resources</li>
            <li>Contact us</li>
            <li>Get started</li>
          </ul>
        </div>
      )}
    </nav>
  );
}

export default Navbar;
